import { Link, useNavigate } from 'react-router-dom';
import './error.scss';

const Error = () => {
    const navigate = useNavigate();

    return (
        <div className='error'>
            <h1>Error 404</h1>
            <button className='primary'>
                Go Back
            </button>
        </div>
    );
};

export default Error;
